import React, {Component} from 'react';
import Typical from 'react-typical';
import './Portfolio.css';

class Portfolio extends Component {

	render() {
		return (
			<div id={'portfolio'} className={'portfolio'}>
				<div className={'heading'}>
					<h1 className={'heading-text'}>Portfolio</h1>
				</div>
				<div className={'content'}>
					<div className="holder">

						<h1>CSS Octagon with pseudo elements, not borders! Much cooler then border version. <br/>It can
							be transparent, have border color and so on...</h1>

						<div className="outter">
							<p>OCTAGON</p>
							<div className="inner">
							</div>
						</div>
					</div>
					<Typical
						steps={['This section is under construction, please be patient...']}
						wrapper="h2"
					/>
				</div>
			</div>
		);
	}
}

export default Portfolio;
